import axios from "axios";

export class RentService{

    baseUrl = "http://localhost:8080/api/v1/rent"


    getRentEmail(email){
        console.log(email);
        return axios.get(this.baseUrl +"?email="+ email).then(res => res.data);
    }

    getRentId(id){
        console.log(id);
        return axios.get(this.baseUrl + "/rented?id=" + id).then(res => res.data).catch('FAIL');
    }

    postCustomer(customer){
        return axios.post(this.baseUrl + "/create", customer).then(res => res.data);
    }
}
